import React from 'react';
import {useEffect} from 'react';

function reducer(state, action) {
    switch (action.type) {
      case "ADD_DEET":
        return [...state, action.payload];
      default:
        return state;
    }
  }

export default function KanyeRest() {

    const [deets, dispatch] = React.useReducer(reducer, []);

    useEffect(() => {

        fetch("https://api.kanye.rest")
        .then(results => results.text())
        .then((data) => {

        const time = 10

        quote = '$console.log(data)'
        const  quote = data
        const deet = {quote, time}



        dispatch({ type: "ADD_DEET", payload: deet })

        });

    }, [])

    return (
    <div className='Fetch' >

<div> 
    {deets.map(({ deet, time }, i) => (
              <ul key={i} >

                <h2>quote</h2>
                <h2>{deet}</h2>
                <h2>{time}</h2>
              </ul>
            ))}
    </div>
    </div>
    )
}
